import { Component, OnInit } from '@angular/core';
import { Observable } from 'rxjs';
import { GetAccomodationsService } from 'src/app/services/get-accomodations.service';
import { Logement } from 'src/models/Logements';

@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.scss']
})

export class HomeComponent implements OnInit {

  accomodation$: Observable <Array<Logement>>;

  constructor(private GetAccomodationsService: GetAccomodationsService){}

  ngOnInit(): void {
    this.accomodation$ = this.GetAccomodationsService.getAccomodations()
  }

}
